import { Pictures } from "./Pictures"
import "../App.css";
import { useDrop } from "react-dnd";
import { useState } from "react";
export const DragAndDrop=()=>{
    const pictureList=[
        {
            id:1,
            url:"data:image/jpeg;base64,"
        },
        {
            id:2,
            url:"data:image/jpeg;base64,"
        },
        {
            id:3,
            url:"data:image/jpeg;base64,"
        },
        {
            id:4,
            url:"data:image/jpeg;base64,"
        }
    ]
    const [board, setBoard] = useState([]);
    const [{isOver}, drop] = useDrop(()=>({
        accept:"image",
        drop:(item)=>addImageToBoard(item.id),
        collect:(monitor)=>({
            isOver:!!monitor.isOver(),
        })
    }))
   const addImageToBoard=(id)=>{
       const filterPictureList = pictureList.filter((picture)=>id === picture.id);
       setBoard((board)=>[...board,filterPictureList[0]]);
    // setBoard([filterPictureList[0]]); 
     // if we want to replace the pictures  instead of addingwhen we drop it to the box
    }
    return(
        <div>
            <div style={{ display: "flex", flexDirection: "row", gap: "10px" }}>

                {
                    pictureList.map((picture)=>{
                        return <Pictures id={picture.id} url={picture.url}/>
                    })
                }
            </div>
            <div
            ref={drop}
            style={{
          width: "500px",
          height: "500px",
          border: "2px solid black",
          marginTop: "20px",
          marginLeft:"400px"
        }}
      >
        {board.map((picture)=>{
            return <Pictures url={picture.url} id={picture.id}/>
        })}
      </div>
        </div>
    )
}